  display: flex;
  justify-content: space-between;
  margin-bottom: 1rem;
  /* width: calc(33% + 1rem); */
    border: 1px white solid;
  `;
  return (
    <Container>
      <MarketOverview />
    </Container>
  );
}

export default HomePageContentContainer;
